import './App.css';
import MenuBar from './components/Menu';
import React from "react";
import { Fragment } from 'react'
import { Popover, Transition } from '@headlessui/react'
import {
  Bars3Icon,
  BookmarkSquareIcon,
  CalendarIcon,
  AcademicCapIcon,
  LifebuoyIcon,
  ShieldCheckIcon,
  CodeBracketIcon,
  XMarkIcon,
  PuzzlePieceIcon,
  MegaphoneIcon,
  BuildingOffice2Icon,
} from '@heroicons/react/24/outline'
import { ChevronDownIcon } from '@heroicons/react/20/solid'

const portfolio = [
  {
    name: 'Academic',
    description: 'Here\'s a couple of stuffs about all my work and studies at school',
    href: '#',
    icon: AcademicCapIcon,
  },
  {
    name: 'Coding Skills',
    description: 'Being a Web/App Developer means mastering a bunch of Abilities',
    href: '#',
    icon: CodeBracketIcon,
  },
  { name: 'Extra Curricular', 
    description: "Apart from Academics, there are a few things I'm Good at", 
    href: '#', 
    icon: PuzzlePieceIcon },
  {
    name: 'Accomplishments ',
    description: "Here I sum up all my accomplishments in a Wide Range of Topics",
    href: '#',
    icon: MegaphoneIcon,
  },
  {
    name: 'My Startup',
    description: 'This page focuses on my startup during my schooldays on Blogging Site',
    href: '#',
    icon: BuildingOffice2Icon,
  },
]
const resources = [
  {
    name: 'Help Center',
    description: 'Get all of your questions answered in our forums or contact support.',
    href: '#',
    icon: LifebuoyIcon,
  },
  {
    name: 'Guides',
    description: 'Learn how to maximize our platform to get the most out of it.',
    href: '#',
    icon: BookmarkSquareIcon,
  },
  {
    name: 'Events',
    description: 'See what meet-ups and other events we might be planning near you.',
    href: '#',
    icon: CalendarIcon,
  },
  { name: 'Security', description: 'Understand how we take your privacy seriously.', href: '#', icon: ShieldCheckIcon },
]

function classNames(...classes) {
  return classes.filter(Boolean).join(' ')
}


function App() {
  return (
    <div className="App">

    </div>
  );
}

export default App;
